INSERT INTO `movie` VALUES (1, '2021-04-27 11:17:33', '2021-04-27 11:17:33', '高山南,山崎和佳奈,小山力也,林原惠美', '日本', '永冈智佳', '全球最⼤体育盛事WSG即将在东京举办开幕式，届时，融合⽇本先进技术打造的最⾼时速可达1000km的“真空超电导磁悬浮”也即将通车。在这个万众瞩⽬的关头，汇集WSG知名赞助商的酒会现场遇到了突发事件，知名企业的⾼官接连遭到绑架，列车启动仪式现场也出现了意外。根据柯南的推理，本次事件也许与⼗五年前在美国波⼠顿发⽣的WSG绑架事件有关。这真的是偶然吗？在各国游客聚集的⽇本到底会发⽣什么样的事件？真空超导磁悬浮启动之时，“危险⼀家⼈”终于集结！', '日语', '名侦探柯南：绯色的子弹', 'D:\\ticketweb_data\\moviepost\\O1CN01gqUQEE1PfaWQK2j4K_!!6000000001868-0-alipicbeacon.jpg_160x240.jpg', 8.00, NULL, 110, 0.00, '动画,动作,悬疑', NULL, b'1');
